    }



    // ����ܧѧ٧��ӧѧ֧� �ӧ�� �է֧��٧ڧ�� (index, deposit, expect) ����֧է֧ݧ֧ߧߧ�ԧ� �ڧߧӧ֧�����, �ާ�اߧ� ��ݧ֧էڧ�� �� ��ѧ٧է֧ݧ� Read contract

    function getDeposits(address depositor) public view returns (uint[] idxs, uint128[] deposits, uint128[] expects) {

